import React from 'react';
import "../styles/caportal.css"

function AboutSection() {
  return (
    <section id="about">
      <div>
        <p className="joining">About Damru</p>
        <p className="text">
          Damru is not just a fest; it's an explosion of creativity, talent, and celebration. From electrifying performances to thought-provoking workshops, Damru promises an immersive experience that transcends boundaries. This year, we're pushing the limits and aiming for new heights, and we want you to be an integral part of this journey.
        </p>
      </div>
    </section>
  );
}

export default AboutSection;
